import React from "react";
import { Switch, Route, Link } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";

class App extends React.Component {
  render(){
    return(
      <div>
       <ul class="nav justify-content" >
       <li class="nav-item">
          <a class="nav-link" href="#">
          <img src="./logo.png" alt="Logo" width="220" height="214" class="d-aline-block align-text-inline"/></a>
        </li>
        <li class="nav-item">
          <a class="nav-link" aria-current="page" href="#">Home</a>
        </li>
        <li class="nav-item">
          <a class="nav-link" href="#">Weekends</a>
        </li>
        <li class="nav-item">
          <a class="nav-link" href="#">Summer 2022</a>
        </li>
        <li class="nav-item">
          <a class="nav-link" href="#">About us</a>
        </li>
      </ul>
         <div class="nav-img">
         <img src="./No4.jpg" class="img-fluid" alt="bckground img"/>
         </div>
    </div>

    )
  }
}

export default App;
